import './categories.sytles.scss'
const App = () => {
  const categeories = [
  { 
    id:1,
    title: 'Hats',
    subtitle: 'ShopNow'

  },
  { 
    id:1,
    title: 'Jackets',
    subtitle: 'ShopNow'

  },
  { 
    id:1,
    title: 'Sneaker',
    subtitle: 'ShopNow'

  },
  { 
    id:1,
    title: 'Man',
    subtitle: 'ShopNow'

  },
  { 
    id:1,
    title: 'Women',
    subtitle: 'ShopNow'

  }
]
  return ( 
     <div className="categeories-container">
        { categeories.map (({title,subtitle}) => (
     <div className="category-container">
       <div className="backgroundImage"/>
       <div className="category-body-container">
        <h2>{title}</h2>
        <p>{subtitle}</p>
       </div>
      </div>
        ) )}

    </div>);
};

export default App;
